import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Numbers from "./Numbers";
import Client from "./Client";
import { arrowFunctionExpression } from "@babel/types";
import BtnPost from "./BtnPost";
import UtgiftTable from "./UtgiftTable";
import post from "./BtnPost"
//import PieChart from "react-minimal-pie-chart";
import { PieChart, Tooltip } from 'recharts';

export default class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = { users: [], loser: true};
        this.update = this.update.bind(this);
        this.post = this.post.bind(this);
        this.fisk = this.fisk.bind(this);
    }

    componentDidMount() {
        this.update();
        
    }
    async update() {
        const response = await fetch("/utgiftlist")
            .then(res => res.json())
            .then(users => this.setState({ users }));

    }

   

    async post () {
        let txt1 = document.getElementById("txt1").value;
        let txt2 = document.getElementById("txt2").value;
        let txt3 = document.getElementById("txt3").value;
        await fetch("http://localhost:8080/utgiftlist", {
            method: "POST",
            headers: {
                Accept: "application/json",
                "Content-Type": "application/json"
            },
            mode: "cors",
            body: JSON.stringify([{ navn: txt1, pris: txt2, kategori: txt3 }])
        });
        this.update();

    }
    fisk(){
        return <label>fitte</label>
    }
  

    render() {
        const data = [{ name: "network", value: 200 }, { name: "network 3", value: 4 }];
        return (
            <div className="App">
                <h1> Utgifter</h1>
                <UtgiftTable users={this.state.users} />
               
                <label>Navn: </label>
                <input type="text" id="txt1" />
                <label>Pris: </label>
                <input type="text" id="txt2" />
                <label>Kategori: </label>
                <input type="text" id="txt3" />
                <button onClick={this.post}>Post</button>
                <PieChart width = {800} height ={400}></PieChart>
  animate={false}
  animationDuration={500}
  animationEasing="ease-out"    
  cx={50}
  cy={50}
  data={[
    {
      color: '#E38627',
      title: 'One',
      value: 10
    },
    {
      color: '#C13C37',
      title: 'Two',
      value: 15
    },
    {
      color: '#6A2135',
      title: 'Three',
      value: 20
    }
  ]}
  label
  labelPosition={50}
  labelStyle={{
    fill: '#121212',
    fontFamily: 'sans-serif',
    fontSize: '7px'
  }}
  labelPosition={50}
  lengthAngle={360}
  lineWidth={100}
  onClick={undefined}
  onMouseOut={undefined}
  onMouseOver={undefined}
  paddingAngle={0}
  radius={50}
  ratio={1}
  rounded={false}
  startAngle={0}
  style={{
    height: '400px'
  }}
/>
            </div>
        );
    }
}


